## approach 3: Sort ad use Binary Search  ## Time Complexity O(N*log(N))
def find_ceil_Floor(x:int,arr:list)-> list:
    sorted_arr = sorted(arr)
    n = len(sorted_arr)
    low, high = 0 ,n-1
    floor_val = ceil_val = -1
    while low <=high:
        mid = low + (high-low) //2

        if x>sorted_arr[mid]:
            low =mid +1
            floor_val = sorted_arr[mid]
        elif x<sorted_arr[mid]:
            high =mid-1
            ceil_val = sorted_arr[mid]
        else:
            floor_val =ceil_val = x
    return [floor_val,ceil_val]

## Approach 4: Using floorDiff and CeilDiff

def getFloorAndCeil(x: int, arr: list) -> list:
    floorVal = -1 # initial val 
    ceilIVal = -1 
    floorDiff = float("inf") # difference between target and arr[i] 
    ceilDiff = float("inf") 
    for i in range(len(arr)):
        fmin = x - arr[i] 
        if fmin >= 0 and fmin < floorDiff:
             floorVal = arr[i] 
             floorDiff = fmin 
        cmin = arr[i] - x 
        if cmin >= 0 and cmin < ceilDiff:
            ceilIVal = arr[i] 
            ceilDiff = cmin 
    return [floorVal, ceilIVal]

